import React, {Component} from 'react';

class Cabecera extends Component{

    render(){
        return (

            <header role="banner" class="header">   
                
            <div className="contenedor">
                
                <img style="display: inline-flex; vertical-align: middle;" src="logoP.png"/>

                <div  style="vertical-align: middle; display: inline-flex; background-color: white; width: 90%; ">
                    <input type="text" style="border-width: 0; height: 30px; width: 100%;" placeholder="Buscar"> </input>
                    <button style="background-color: rgba(128, 128, 128, 0.185); border-width: 0; cursor: pointer; " type="button">
                        <i class="fa fa-search"></i>
                    </button>
                </div>

            </div>        
                       
            </header>
        )
    }
}
export default Cabecera;
